A Message represents the basic unit of translation in Fluent. This is the simplest form messages can take: welcome-msg = Hello, World! welcome-msg is the message identifier (or message ID), and Hello, World! is the value of this message. Messages can contain variables , for example: welcome-msg = Welcome { $user } $user is the name of the variable, and should never be translated. The fragment included between curly braces is called a placeable , and can be moved within the text. For example, the message above would be translated in Italian as follows, leaving the placeable unchanged: welcome-msg = Benvenuto { $user } Messages can also reference other messages. In this case, the placeable won’t include the $ sign, simply the message identifier: menu-settings = Settings
help-menu-settings = Click { menu-settings } to save the file. A Term is a special category of Message: Terms have identifiers starting with a dash, e.g. -brand-short-name. They can’t be called directly in the source code, but only referenced within other messages. Each localization can add or remove attributes, regardless of the reference language (typically en-US). For example, a term is used to define the Firefox brand name. For more details, see this document . -brand-short-name = Firefox
close-msg = Close { -brand-short-name }
